script: |
  super -f text -I q1355.spq | sort > q1355.out

inputs:
  - name: q1355.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + CAST ( NULL AS INTEGER ) NOT IN ( + col2 + + - col0, - col2 * 91 * + ( + col0 ) / + col1, + col1, + - 12, + col2 ) AND NOT ( col0 IS NULL );
  - name: tab0

outputs:
  - name: q1355.out
    data: |
